class Solution(object):
    def findMaxConsecutiveOnes(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        k = 0
        maxLen = 0
        for i in range(len(nums)):
            if nums[i] == 1:
                k += 1
            elif nums[i] == 0:
                maxLen = max(k, maxLen)
                k = 0

        return max(maxLen, k)

